        console.log(test);
    })
    it('Update user information for created user in the previous step',() => {
        const data = {
            first_name: `Roopa${(Math.floor(Math.random() * 6666))}`,
            last_name: "R R"
        };

        return request
        .put(`users/${newId}`)
    })


})

